import React from 'react';
import resume from './images/Resume.jpg';
import logo from './logo.svg';
import './App.css';
import Button from 'react-bootstrap/Button';
import ButtonToolbar from "react-bootstrap/ButtonToolbar";

function App() {
  return (
      <div>
          <ButtonToolbar>
          <Button variant="outline-primary" size="lg"> First Button </Button>
          <Button variant="outline-primary" size="lg"> Second Button </Button>
          <Button variant="outline-primary" size="lg"> Third Button </Button>
          </ButtonToolbar>
      </div>


